import React from 'react';
import './App.css';
import Header from './header'
import PokeCard from './pokeCard'

function App() {
  return (
    <div className="App">
      <header>
      </header>
      <Header></Header>
      <div class="grid-container">
        <div class="grid-item"> <PokeCard/></div>
        <div class="grid-item"><PokeCard/></div>
        <div class="grid-item"><PokeCard/></div>
        <div class="grid-item"><PokeCard/></div>
        <div class="grid-item"><PokeCard/></div>
        <div class="grid-item"><PokeCard/></div>
        <div class="grid-item"><PokeCard/></div>
        <div class="grid-item"><PokeCard/></div>
        <div class="grid-item"><PokeCard/></div>
    </div>
    </div>
  );
}

export default App;
